import React from "react";
import "./Home.css"; // Ensure CSS file is properly imported

const Home = () => {
  // Function to open chatbot in a new full-screen tab
  const openChatbot = () => {
    window.open("/chatbot", "_blank");
  };

  return (
    <div className="home">
      {/* Landing Section with Background Image */}
      <section className="landing">
        style={{ backgroundImage: 'url("/assets/bk2.png")' }} // Correct usage
        of url
        <h1>WELCOME TO MUSEUM TICKET BOOKING</h1>
      </section>

      {/* Explore Museums Section */}
      <section className="explore">
        <h2>EXPLORE MUSEUM</h2>
        <div className="museum-gallery">
          {[
            {
              src: "/assets/national_m.jpg",
              name: "National Museum",
              location: "New Delhi",
            },
            {
              src: "/assets/police_m.jpg",
              name: "Police Museum",
              location: "Chennai",
            },
            {
              src: "/assets/seashell_m.jpg",
              name: "Seashell Museum",
              location: "Mahabalipuram",
            },
            {
              src: "/assets/museum3.png",
              name: "Albert Hall Museum",
              location: "Jaipur",
            },
            {
              src: "/assets/museum6.png",
              name: "Folklore Museum",
              location: "Mysore",
            },
            {
              src: "/assets/museum4.png",
              name: "Payana Museum",
              location: "Bangalore",
            },
            {
              src: "/assets/museum7.png",
              name: "Rail Museum",
              location: "Delhi",
            },
            {
              src: "/assets/museum8.png",
              name: "Science Museum",
              location: "Kolkata",
            },
            {
              src: "/assets/museum9.png",
              name: "Art Museum",
              location: "Mumbai",
            },
          ].map((museum, index) => (
            <div className="museum-item" key={index}>
              <img src={museum.src} alt={museum.name} />
              <div className="museum-info">
                <p>{museum.name}</p>
                <p>{museum.location}</p>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Chatbot Icon */}
      <div className="chatbot-icon" onClick={openChatbot}>
        <img src="/assets/chat_icon.jpg" alt="Chatbot" />
        <span className="tooltip">
          I'm your AI assistant for ticket booking
        </span>
      </div>
    </div>
  );
};

export default Home;
